--
-- Create procedure `Proc_GetDeclarationDetailRecord`
--
CREATE PROCEDURE Proc_GetDeclarationDetailRecord (IN declarationID char(36), IN keyword varchar(255), IN organizationUnitID text)
SQL SECURITY INVOKER
COMMENT 'Lấy danh sách chi tiết trong tờ khai thuế'
BEGIN

  SELECT
    COUNT(*)
  FROM DeclarationDetail dd
  WHERE dd.DeclarationID = declarationID
  AND (keyword IS NULL
