END
$$

--
-- Create procedure `Proc_GetDeclarationDetailByCode`
--
CREATE PROCEDURE Proc_GetDeclarationDetailByCode (IN CitizenIdentityNo varchar(50), IN TaxNo varchar(255), IN EmployeeCode varchar(255), IN DeclarationID char(36))
SQL SECURITY INVOKER
COMMENT 'Lấy thông tin chi tiết người nộp thuế số cmt/ hộ chiếu hoặc mã nhân viên'
BEGIN

  --    Tìm kiếm theo chưng minh thư hoặc mã số thuế (ưu tiên cmt)
  IF (CitizenIdentityNo IS NOT NULL
    OR CitizenIdentityNo <> ''
    OR TaxNo IS NOT NULL
    OR TaxNo <> '') THEN
    SELECT
      *
    FROM DeclarationDetail dd
    WHERE (dd.CitizenIdentityNo = CitizenIdentityNo
    AND CitizenIdentityNo IS NOT NULL
    AND CitizenIdentityNo <> '')
    AND dd.DeclarationID = DeclarationID
    UNION ALL
    (SELECT
        *
      FROM DeclarationDetail dd
      WHERE dd.TaxNo = TaxNo
      AND TaxNo IS NOT NULL
      AND TaxNo <> ''
      AND dd.DeclarationID = DeclarationID);

  ELSEIF (EmployeeCode IS NOT NULL
    OR EmployeeCode <> '') THEN
    SELECT
      *
    FROM DeclarationDetail dd
    WHERE dd.EmployeeCode = EmployeeCode
    AND dd.DeclarationID = DeclarationID;
  END IF;
END
$$

