  TaxPercent decimal(5, 2) DEFAULT NULL COMMENT 'Thuế suất. giá trị là 0-100',
  TaxType int(11) DEFAULT NULL COMMENT 'Kê khai cho: 0- Thu nhập từ tiền lương tiền công, 1- Thu nhập từ xổ số,2 - Thu nhập từ bảo hiểm, ()',
