--
-- Create procedure `Proc_GetTaxInfoByType`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetTaxInfoByType (IN taxType int, IN date DATE)
COMMENT 'Lấy thông tin thuế theo dạng thuế'
BEGIN
  SELECT
    *
  FROM TaxInfo ti
  WHERE taxType = ti.TaxType
  AND ((DATE(date) >= ti.ApplyDate
  AND DATE(date) < ti.FinishApplyDate)
  OR (DATE(date) >= ti.ApplyDate
  AND ti.FinishApplyDate IS NULL));
END
$$

