--
-- Create procedure `Proc_UpdateTaxAgent`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_UpdateTaxAgent (IN TaxAgentID char(36), IN TaxAgentName varchar(255), IN TaxAgentTaxNo varchar(25), IN PlaceName varchar(255), IN OrganizationID char(36), IN FaxNo varchar(50), IN Email varchar(100), IN Phone varchar(50), IN ProvinceID int(11), IN DistrictID int(11), IN ContractNo varchar(25), IN TaxAgentEmployee varchar(100), IN PracticingCertifacateNo varchar(25), IN ContractDate date, IN ModifiedBy varchar(100))
COMMENT 'Cập nhật đại lý thuế'
BEGIN
  UPDATE TaxAgent t
  SET t.TaxAgentName = TaxAgentName,
      t.TaxAgentTaxNo = TaxAgentTaxNo,
      t.PlaceName = PlaceName,
      t.OrganizationID = OrganizationID,
      t.FaxNo = FaxNo,
      t.Email = Email,
      t.Phone = Phone,
      t.ProvinceID = ProvinceID,
      t.DistrictID = DistrictID,
      t.ContractNo = ContractNo,
      t.TaxAgentEmployee = TaxAgentEmployee,
      t.PracticingCertifacateNo = PracticingCertifacateNo,
      t.ContractDate = ContractDate,
      t.ModifiedBy = ModifiedBy,
      t.ModifiedDate = NOW()
  WHERE t.TaxAgentID = TaxAgentID;
END
$$

--
-- Create procedure `Proc_InsertTaxAgent`
--
CREATE PROCEDURE Proc_InsertTaxAgent (IN TaxAgentID char(36), IN OrganizationID char(36), IN TaxAgentName varchar(255), IN TaxAgentTaxNo varchar(20), IN PlaceName varchar(255), IN FaxNo varchar(50), IN Email varchar(100), IN Phone varchar(50), IN ProvinceID int(11), IN DistrictID int(11), IN ContractNo varchar(255), IN TaxAgentEmployee varchar(100), IN PracticingCertifacateNo varchar(255), IN ContractDate date, IN CreatedBy varchar(100))
SQL SECURITY INVOKER
COMMENT 'Thêm mới một đại lý thuế'
BEGIN
  IF TaxAgentID IS NULL
    OR TaxAgentID = '00000000-0000-0000-0000-000000000000' THEN
    SET TaxAgentID = UUID();
  END IF;
  OrganizationID,
  TaxAgentName,
  TaxAgentTaxNo,
  PlaceName,
  FaxNo,
  Email,
  Phone,
  ProvinceID,
  DistrictID,
  ContractNo,
  TaxAgentEmployee,
  PracticingCertifacateNo,
  ContractDate,
  CreatedDate,
  CreatedBy,
  ModifiedDate,
  ModifiedBy)
    VALUES (TaxAgentID, OrganizationID, TaxAgentName, TaxAgentTaxNo, PlaceName, FaxNo, Email, Phone, ProvinceID, DistrictID, ContractNo, TaxAgentEmployee, PracticingCertifacateNo, ContractDate, NOW(), CreatedBy, NOW(), CreatedBy);
  SELECT
    TaxAgentID;
END
$$

