--
-- Create view `View_DeclarationDetail`
--
CREATE
DEFINER = 'root'@'%'
VIEW View_DeclarationDetail
AS
SELECT
  `dd`.`DeclarationDetailID` AS `DeclarationDetailID`,
  `dd`.`DeclarationID` AS `DeclarationID`,
  `dd`.`TaxNo` AS `TaxNo`,
  `dd`.`EmployeeID` AS `EmployeeID`,
  `dd`.`EmployeeCode` AS `EmployeeCode`,
  `dd`.`FullName` AS `FullName`,
  `dd`.`DateOfBirth` AS `DateOfBirth`,
  `dd`.`IndentityType` AS `IndentityType`,
  `dd`.`CitizenIdentityNo` AS `CitizenIdentityNo`,
  `dd`.`CitizenIdentityDate` AS `CitizenIdentityDate`,
  `dd`.`CitizenIdentityNoStatus` AS `CitizenIdentityNoStatus`,
  `dd`.`OrganizationUnitName` AS `OrganizationUnitName`,
  `dd`.`NationalityID` AS `NationalityID`,
  `dd`.`CitizenIdentityPlaceID` AS `CitizenIdentityPlaceID`,
  `dd`.`PositionID` AS `PositionID`,
  `dd`.`Phone` AS `Phone`,
  `dd`.`Gender` AS `Gender`,
  `dd`.`Email` AS `Email`,
  `dd`.`NationalIDByHousehold` AS `NationalIDByHousehold`,
  `dd`.`ProvinceIDByHousehold` AS `ProvinceIDByHousehold`,
  `dd`.`DistrictIDByHousehold` AS `DistrictIDByHousehold`,
  `dd`.`WardIDByHousehold` AS `WardIDByHousehold`,
  `dd`.`AddressByHousehold` AS `AddressByHousehold`,
  `dd`.`NationalIDByResident` AS `NationalIDByResident`,
  `dd`.`ProvinceIDByResident` AS `ProvinceIDByResident`,
  `dd`.`DistrictIDByResident` AS `DistrictIDByResident`,
  `dd`.`WardIDByResident` AS `WardIDByResident`,
  `dd`.`AddressByResident` AS `AddressByResident`,
  `dd`.`CreatedBy` AS `CreatedBy`,
  `dd`.`CreatedDate` AS `CreatedDate`,
  `dd`.`ModifiedBy` AS `ModifiedBy`,
  `dd`.`ModifiedDate` AS `ModifiedDate`,
  `n`.`NationalityName` AS `NationalityName`,
  `n1`.`NationalityName` AS `NationalNameByHousehold`,
  `p`.`ProvinceName` AS `ProvinceNameByHousehold`,
  `d`.`DistrictName` AS `DistrictNameByHousehold`,
  `w`.`WardName` AS `WardNameByHousehold`,
  `n2`.`NationalityName` AS `NationalNameByResident`,
  `p1`.`ProvinceName` AS `ProvinceNameByResident`,
  `d1`.`DistrictName` AS `DistrictNameByResident`,
  `w1`.`WardName` AS `WardNameByResident`,
  `d2`.`DBOptionName` AS `IndentityTypeName`,
  `poi`.`PlaceOfIssueName` AS `CitizenIdentityPlaceName`
FROM (((((((((((`DeclarationDetail` `dd`
  LEFT JOIN `Nationality` `n`
    ON (`n`.`NationalityID` = `dd`.`NationalityID`))
  LEFT JOIN `Nationality` `n1`
    ON (`n1`.`NationalityID` = `dd`.`NationalIDByHousehold`))
  LEFT JOIN `Province` `p`
    ON (`p`.`ProvinceID` = `dd`.`ProvinceIDByHousehold`))
  LEFT JOIN `District` `d`
    ON (`d`.`DistrictID` = `dd`.`DistrictIDByHousehold`))
  LEFT JOIN `Ward` `w`
    ON (`w`.`WardID` = `dd`.`WardIDByHousehold`))
  LEFT JOIN `Nationality` `n2`
    ON (`n2`.`NationalityID` = `dd`.`NationalIDByResident`))
  LEFT JOIN `Province` `p1`
    ON (`p1`.`ProvinceID` = `dd`.`ProvinceIDByResident`))
  LEFT JOIN `District` `d1`
    ON (`d1`.`DistrictID` = `dd`.`DistrictIDByResident`))
  LEFT JOIN `Ward` `w1`
    ON (`w1`.`WardID` = `dd`.`WardIDByResident`))
  LEFT JOIN `DBOption` `d2`
    ON (`d2`.`DBOptionID` = `dd`.`IndentityType`))
  LEFT JOIN `PlaceOfIssue` `poi`
    ON (`poi`.`PlaceOfIssueID` = `dd`.`CitizenIdentityPlaceID`));

DELIMITER $$

