    VALUE (OrganizationID, OrganizationName, OrganizationTaxNo, TaxPlaceName, TaxPlaceID, NationalityID, ProvinceID, DistrictID, WardID, FaxNo, TaxDate, Email, Phone, EmployeeID, EmployeeName, SignDate, SignBy, PracticingCertifacateNo, IsUseMTax, NOW(), CreatedBy, NOW(), CreatedBy, BankID, BankNo, CAUnitName, CAUnitManage, OrganizationParentId, OrganizationAmisId, OrganizationUnit, TenantID, IsParent);

  SELECT
    OrganizationID AS Result;
END
$$

--
-- Create procedure `Proc_GetOrganizationUnitForSelect`
