CREATE PROCEDURE Proc_GetOrganizationUnitForSelect (IN OrganizationID char(36))
SQL SECURITY INVOKER
COMMENT 'Lấy thông tin đơn vị để dùng chọn'
BEGIN
  DECLARE organizationAmisID char(36) DEFAULT NULL;
  SET organizationAmisID = (SELECT
      o.OrganizationAmisId
    FROM Organzation o
    WHERE o.OrganizationID = OrganizationID);

  SELECT
    ou.OrganizationUnitID,
    ou.OrganizationUnitCode,
    ou.OrganizationUnitName
  FROM OrganizationUnit ou
  WHERE ou.ParentID = organizationAmisID;
END
$$

