--
-- Create procedure `Proc_GetDeclarationByTaxCode`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetDeclarationByTaxCode (IN TaxCode char(36), IN FromDay date, IN ToDay date)
COMMENT 'Lấy danh sách tờ khai thuế theo MST, trạng thái chưa nộp TCT thành công'
BEGIN
  SELECT
    d.*
  FROM Declaration d
    LEFT JOIN Organzation o
      ON d.OrganizationID = o.OrganizationID
  WHERE o.OrganizationTaxNo = TaxCode
  AND (d.SendDate BETWEEN FromDay AND ToDay)
  AND d.DeclarationStatus = 2;
END
$$

