--
-- Create procedure `Proc_InsertDeclaration`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_InsertDeclaration (IN DeclarationID char(36), IN DeclarationName varchar(255), IN GroupType int, IN PeriodYear int, IN PeriodMonthOrQuarter int, IN OrganizationID char(36), IN CreatedBy varchar(100), IN TaxType int)
COMMENT 'Thêm mới tờ khai'
BEGIN
  DECLARE lastNumber int DEFAULT 0;

  IF (GroupType BETWEEN 20 AND 22) THEN
    SET lastNumber = (SELECT
        COUNT(*)
      FROM Declaration d
      WHERE d.GroupType = GroupType
      AND PeriodYear = d.PeriodYear);
    SET lastNumber = lastNumber + 1;
  END IF;
  IF (GroupType BETWEEN 0 AND 19) THEN
    SET lastNumber = (SELECT
        d.NumberOfDeclaration
      FROM Declaration d
      WHERE d.GroupType = GroupType
      AND d.PeriodYear = PeriodYear
      AND d.PeriodMonthOrQuarter = PeriodMonthOrQuarter
      AND d.TaxType = TaxType);
    IF (lastNumber IS NULL) THEN
      SET lastNumber = 0;
    END IF;
    SET lastNumber = lastNumber + 1;
  END IF;
  IF DeclarationID IS NULL THEN
    SET DeclarationID = UUID();
  END IF;

  DeclarationName,
  GroupType,
  PeriodYear,
  TaxType,
  PeriodMonthOrQuarter,
  NumberOfDeclaration,
  CreatedBy,
  CreatedDate,
  ModifiedDate, ModifiedBy,
  OrganizationID,
  OrganizationTaxNo,
  OrganizationName,
  TaxPlaceName,
  TaxPlaceID,
  NationalID,
  ProvinceID,
  DistrictID,
  WardID,
  FaxNo,
  TaxDate,
  Email,
  Phone,
  EmployeeName,
  CAUnitName,
  CAUnitManage,
  TaxAgentName,
  TaxAgentTaxNo,
  TaxAgentPlaceName,
  TaxAgentFaxNo,
  TaxAgentEmail,
  TaxAgentPhone,
  TaxAgentProvinceID,
  TaxAgentDistrictID,
  TaxAgentContractNo,
  TaxAgentEmployee,
  TaxAgentPracticingCertifacateNo)
    SELECT
      DeclarationID,
      DeclarationName,
      GroupType,
      PeriodYear,
      TaxType,
      PeriodMonthOrQuarter,
      lastNumber AS NumberOfDeclaration,
      CreatedBy,
      CURDATE(),
      CURDATE(),
      CreatedBy,
      OrganizationID,
      o.OrganizationTaxNo,
      o.OrganizationName,
      o.TaxPlaceName AS TaxPlaceName,
      o.TaxPlaceID,
      o.NationalityID,
      o.ProvinceID,
      o.DistrictID,
      o.WardID,
      o.FaxNo,
      o.TaxDate,
      o.Email,
      o.Phone,
      o.EmployeeName,
      o.CAUnitName,
      o.CAUnitManage,

      ta.TaxAgentName,
      ta.TaxAgentTaxNo,
      ta.PlaceName,
      ta.FaxNo,
      ta.Email,
      ta.Phone,
      ta.ProvinceID,
      ta.DistrictID,
      ta.ContractNo,
      ta.TaxAgentEmployee,
      ta.PracticingCertifacateNo
    FROM Organzation o
      LEFT JOIN TaxAgent ta
        ON ta.OrganizationID = o.OrganizationID
    WHERE o.OrganizationID = OrganizationID;
  SELECT
    DeclarationID;
END
$$

