--
-- Create procedure `Proc_GetOrganizationAndOrganizationTaxNo`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetOrganizationAndOrganizationTaxNo (IN startDate datetime, IN endDate datetime)
COMMENT 'Lấy thông tin tổ chức đã gửi TK từ ngày startDate tới ngày endDate'
BEGIN
  SELECT DISTINCT
    d.OrganizationID,
    o.OrganizationTaxNo
  FROM Declaration d
    LEFT JOIN Organzation o
      ON d.OrganizationID = o.OrganizationID
  WHERE d.SendDate BETWEEN startDate AND endDate;
END
$$

--
-- Create procedure `Proc_GetNumOfDeclarationsSendToGDT`
--
CREATE DEFINER = 'mintax'@'%'
PROCEDURE Proc_GetNumOfDeclarationsSendToGDT (IN year int(4), IN taxType int(11), IN periodMonthOrQuarter int(11), IN organizationID char(36))
COMMENT 'Lấy số lượng tờ khai đã gửi sang tổng cục thuế'
BEGIN
  SELECT
    COUNT(*)
  FROM Declaration d
  WHERE d.PeriodYear = year
  AND d.TaxType = taxType
  AND d.OrganizationID = organizationID
  AND d.PeriodMonthOrQuarter = periodMonthOrQuarter
  AND d.DeclarationStatus BETWEEN 3 AND 4;
END
