--
-- Create procedure `Proc_GetDeclarationRecord`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetDeclarationRecord (IN groupType varchar(255), IN keyword varchar(255), IN month int, IN year int, IN organizationID char(36), IN declarationStatus int(11))
COMMENT 'Lấy tổng số bản ghi'
BEGIN

  SELECT
    COUNT(*) AS TotalRecord
  FROM Declaration d
  WHERE (groupType REGEXP CONCAT('\-', CAST(d.GroupType AS char), '(?=\-)') != 0)
  AND (year = 0
  OR year = d.PeriodYear)
  AND d.OrganizationID = organizationID
  AND (month = 0
  OR month IS NULL
  OR ((CASE WHEN d.TaxType = 1 AND
      month <= 12 AND
      month > 0 THEN d.PeriodMonthOrQuarter = month WHEN d.TaxType = 2 AND
      month > 12 THEN (d.PeriodMonthOrQuarter = month - 12) END)))
  AND (keyword IS NULL
  OR keyword = ''
  OR d.DeclarationName LIKE CONCAT('%', keyword, '%'))
  AND (declarationStatus IS NULL
  OR (declarationStatus = 0)
  OR (declarationStatus = d.DeclarationStatus));

END
$$

