--
-- Create procedure `Proc_CheckDeclarationEmpty`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_CheckDeclarationEmpty (IN groupType varchar(255), IN organizationID char(36))
COMMENT 'Check xem co du lieu trong database khong'
BEGIN
  DECLARE EMPTY tinyint DEFAULT 0;
  IF (EXISTS (SELECT
        1
      FROM Declaration d
      WHERE d.OrganizationID = organizationID
      AND (groupType REGEXP CONCAT('\-', CAST(d.GroupType AS char), '(?=\-)') != 0))) THEN
    SET EMPTY = 0;
  ELSE
    SET EMPTY = 1;
  END IF;
  SELECT
    EMPTY AS Data;
END
$$

