--
-- Create procedure `Proc_UpdateDeclarationAppendix`
--
CREATE PROCEDURE Proc_UpdateDeclarationAppendix (IN DeclarationAppendixID char(36), IN DeclarationPartialID char(36), IN TotalIncome decimal(22, 4), IN IncomeTaxable decimal(22, 4), IN TaxIncurred decimal(22, 4), IN TotalReduction decimal(22, 4), IN TotalTaxWithHeld decimal(22, 4))
SQL SECURITY INVOKER
COMMENT 'Cập nhạt lũy kế ~ phụ lục'
BEGIN
  UPDATE DeclarationAppendix da
  SET da.TotalIncome = TotalIncome,
      da.IncomeTaxable = IncomeTaxable,
      da.TaxIncurred = TaxIncurred,
      da.TotalReduction = TotalReduction,
      da.TotalTaxWithHeld = TotalTaxWithHeld
  WHERE DeclarationAppendixID = da.DeclarationAppendixID;
END
$$

--
-- Create procedure `Proc_InsertDeclarationAppendix`
--
CREATE PROCEDURE Proc_InsertDeclarationAppendix (IN DeclarationAppendixID char(36), IN DeclarationPartialID char(36), IN TotalIncome decimal(22, 4), IN IncomeTaxable decimal(22, 4), IN TaxIncurred decimal(22, 4), IN TotalReduction decimal(22, 4), IN TotalTaxWithHeld decimal(22, 4))
SQL SECURITY INVOKER
COMMENT 'Thêm mới lũy kế ~ phụ lục'
BEGIN
  IF (DeclarationAppendixID IS NULL
    OR DeclarationAppendixID = '00000000-0000-0000-0000-000000000000') THEN
    SET DeclarationAppendixID = UUID();
  END IF;
    VALUE (DeclarationAppendixID, DeclarationPartialID, TotalIncome, IncomeTaxable, TaxIncurred, TotalReduction, TotalTaxWithHeld);
  SELECT
    DeclarationAppendixID;
END
$$

