--
-- Create procedure `Proc_GetDeclarationPaging`
--
CREATE PROCEDURE Proc_GetDeclarationPaging (IN groupType varchar(255), IN keyword varchar(255), IN month int, IN year int, IN pageIndex int, IN pageSize int, IN organizationID char(36), IN declarationStatus int(11))
SQL SECURITY INVOKER
COMMENT 'Lấy danh sách tờ khai theo bộ lọc'
BEGIN
  DECLARE temp int(11) DEFAULT 0;
  SET temp = (pageIndex - 1) * pageSize;
  SELECT
    d.DeclarationID,
    d.DeclarationName,
    d.DeclarationCode,
    d.DeclarationType,
    d.PeriodYear,
    d.PeriodMonthOrQuarter,
    d.TaxType,
    d.GroupType,
    d.SendBy,
    d.SendDate,
    d.SubmissionID,
    d.DeclarationStatus,
    d.OrganizationID,
    d.OrganizationTaxNo,
    d.NumberOfDeclaration,
    d.CreatedBy,
    d.CreatedDate,
    d.ModifiedDate,
    d.ModifiedBy,
    SUM(dp.TotalTaxWithHeld) AS TotalTaxWithHeld
  FROM Declaration d
    LEFT JOIN DeclarationPartial dp
      ON dp.DeclarationID = d.DeclarationID
  WHERE d.OrganizationID = organizationID
  AND (groupType REGEXP CONCAT('\-', CAST(d.GroupType AS char), '(?=\-)') != 0)
  AND (month = 0
  OR month IS NULL
  OR ((CASE WHEN d.TaxType = 1 AND
      month <= 12 AND
      month > 0 THEN d.PeriodMonthOrQuarter = month WHEN d.TaxType = 2 AND
      month > 12 THEN (d.PeriodMonthOrQuarter = month - 12) WHEN d.TaxType = 0 THEN EXTRACT(MONTH FROM d.CreatedDate) = month END)))
  AND (year = 0
  OR year IS NULL
  OR (year = d.PeriodYear))
  AND (keyword IS NULL
  OR keyword = ''
  OR d.DeclarationName LIKE CONCAT('%', keyword, '%'))
  AND (declarationStatus IS NULL
  OR (declarationStatus = 0)
  OR (declarationStatus = d.DeclarationStatus))
  GROUP BY d.DeclarationID
  LIMIT pageSize
  OFFSET temp;
END
$$

--
-- Create procedure `Proc_GetDeclarationByTemporaryTaxID`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetDeclarationByTemporaryTaxID (IN temporaryTaxID char(36))
COMMENT 'Tìm tờ khai cuối theo Id bảng tính'
BEGIN
  SELECT
    d.*
  FROM View_Declaration d
    LEFT JOIN DeclarationPartial dp
      ON d.DeclarationID = dp.DeclarationID
  WHERE dp.TemporaryTaxID = temporaryTaxID
  ORDER BY d.NumberOfDeclaration DESC
  LIMIT 1;
END
$$

--
-- Create procedure `Proc_DeleteDeclarationByTemporaryID`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_DeleteDeclarationByTemporaryID (IN temporaryTaxID char(36), OUT Result int)
COMMENT 'Xóa tờ khai bởi ID bảng tính thuế'
BEGIN
  --   Nếu tờ khai đã có một chi tiết thuojc bảng tính thuế khác thì không thể xóa tờ khai mà chỉ xóa chi tiết đó
  IF ((SELECT
        COUNT(*)
      FROM DeclarationPartial dp
        LEFT JOIN TemporaryTax tt
          ON tt.TemporaryTaxID = dp.TemporaryTaxID
      WHERE dp.IncomeType <> tt.IncomeType) > 0) THEN
    DELETE
      FROM DeclarationPartial
    WHERE temporaryTaxID = DeclarationPartial.TemporaryTaxID;
    SET Result = 3;
  ELSE
    DELETE
      FROM Declaration
    WHERE Declaration.DeclarationID IN (SELECT
          dp.DeclarationID
        FROM DeclarationPartial dp
        WHERE dp.TemporaryTaxID = temporaryTaxID);
    SET Result = 1;
  END IF;
END
$$

