-- Create procedure `Proc_CheckExistSentDeclaration`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_CheckExistSentDeclaration (IN temporaryTaxID varchar(255))
COMMENT 'Kiểm tra đã có tờ khai naofguiwr đi chưa'
BEGIN
  DECLARE Result int DEFAULT 0;
  IF ((SELECT
        COUNT(dp.DeclarationPartialID)
      FROM DeclarationPartial dp
        LEFT JOIN Declaration d
          ON d.DeclarationID = dp.DeclarationPartialID
      WHERE dp.TemporaryTaxID = temporaryTaxID
      AND d.DeclarationStatus > 1) > 0) THEN
    SET Result = 0;
  ELSE
    SET Result = 1;
  END IF;
  SELECT
    Result AS Result;
END
$$

