--
-- Create procedure `Proc_GetDeclarationDetailPaging`
--
CREATE PROCEDURE Proc_GetDeclarationDetailPaging (IN declarationID char(36), IN keyword varchar(255), IN organizationUnitID text, IN pageIndex int, IN pageSize int)
SQL SECURITY INVOKER
COMMENT 'Lấy danh sách chi tiết trong tờ khai thuế'
BEGIN
  DECLARE declarationGroupType int DEFAULT 0;
  DECLARE temp int(11) DEFAULT 0;
  SET temp = (pageIndex - 1) * pageSize;
  SET declarationGroupType = (SELECT
      d.GroupType
    FROM Declaration d
    WHERE d.DeclarationID = declarationID);

  SELECT
    dd.*,
    CAST(SUM(CASE WHEN ddd.DependentType = 0 THEN 1 ELSE 0 END) AS int) AS NumberDependentIncrease,
    CAST(SUM(CASE WHEN ddd.DependentType = 1 THEN 1 ELSE 0 END) AS int) AS NumberDependentReduced
  FROM DeclarationDetail dd
    LEFT JOIN DeclarationDetailDependent ddd
      ON ddd.DeclarationDetailID = dd.DeclarationDetailID
  WHERE dd.DeclarationID = declarationID
  AND (keyword IS NULL
  OR keyword = ''
  OR dd.FullName LIKE CONCAT('%', keyword, '%')
  OR dd.EmployeeCode LIKE CONCAT('%', keyword, '%'))
  AND ((organizationUnitID IS NULL)
  OR (organizationUnitID = '')
  OR organizationUnitID LIKE CONCAT('%', '/', dd.OrganizationUnitID, '/', '%'))
  GROUP BY dd.DeclarationDetailID
  LIMIT pageSize
  OFFSET temp;


END
$$

