COMMENT = 'Các dạng tính thuế';

DELIMITER $$

--
-- Create procedure `Proc_UpdateDeclarationPartial`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_UpdateDeclarationPartial (IN DeclarationPartialID char(36), IN TemporaryTaxID char(36), IN DeclarationID char(36), IN IncomeType int, IN NumberOfEmployee int, IN NumberOfResidentContract int, IN NumberOfEmployeeDeductResident int, IN NumberOfEmployeeDeductNonResident int, IN TotalIncomeTaxResident decimal, IN TotalIncomeTaxNonResident decimal, IN TotalIncomeTaxDeductedResident decimal, IN TotalIncomeTaxDeductedNonResident decimal, IN TotalTaxResident decimal, IN TotalTaxNonResident decimal, IN TotalIncome decimal, IN IncomeTaxable decimal, IN TaxIncurred decimal, IN TotalReduction decimal, IN TotalTaxWithHeld decimal, IN ModifiedDate varchar(255), IN ModifiedBy varchar(100))
COMMENT 'Cập nhật vào chi tiết tờ khai thuế'
BEGIN
  DECLARE GroupType int DEFAULT 0;
  SET GroupType = (SELECT
      d.GroupType
    FROM Declaration d
    WHERE d.DeclarationID = DeclarationID);
  IF (GroupType = 5) THEN
    UPDATE DeclarationPartial dp
    SET dp.TemporaryTaxID = TemporaryTaxID,
        dp.DeclarationID = DeclarationID,
        dp.IncomeType = IncomeType,
        dp.NumberOfEmployee = NumberOfEmployee,
        dp.NumberOfResidentContract = NumberOfResidentContract,
        dp.NumberOfEmployeeDeductResident = NumberOfEmployeeDeductResident,
        dp.NumberOfEmployeeDeductNonResident = NumberOfEmployeeDeductNonResident,
        dp.TotalIncomeTaxResident = TotalIncomeTaxResident,
        dp.TotalIncomeTaxNonResident = TotalIncomeTaxNonResident,
        dp.TotalIncomeTaxDeductedResident = TotalIncomeTaxDeductedResident,
        dp.TotalIncomeTaxDeductedNonResident = TotalIncomeTaxDeductedNonResident,
        dp.TotalTaxResident = TotalTaxResident,
        dp.TotalTaxWithHeld = TotalTaxWithHeld,

        dp.TotalTaxNonResident = TotalTaxNonResident
    WHERE dp.DeclarationPartialID = DeclarationPartialID;
  ELSEIF (GroupType = 6) THEN
    UPDATE DeclarationPartial dp
    SET dp.IncomeTaxable = IncomeTaxable,
        dp.TotalTaxWithHeld = TotalTaxWithHeld
    WHERE dp.DeclarationPartialID = DeclarationPartialID;
  ELSEIF (GroupType = 1) THEN
    UPDATE DeclarationPartial dp
    SET dp.TotalIncome = TotalIncome,
        dp.IncomeTaxable = IncomeTaxable,
        dp.TaxIncurred = TaxIncurred,
        dp.TotalReduction = TotalReduction,
        dp.TotalTaxWithHeld = TotalTaxWithHeld
    WHERE dp.DeclarationPartialID = DeclarationPartialID;
  END IF;
END
$$

--
-- Create procedure `Proc_InsertTemporaryTax`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_InsertTemporaryTax (IN TemporaryTaxID char(36), IN TemporaryTaxName varchar(255), OUT Status int, IN CreatedBy varchar(100), IN PeriodYear varchar(20), IN TemporaryTaxType int, IN PeriodMonthOrQuarter int, IN IncomeType int, IN OrganizationID char(36), IN FromDate date, IN ToDate date, IN GroupType int)
COMMENT 'Tạo hồ sơ xong lấy địa chỉ id chuyển đến bảng tạm tính của hồ sơ vừa thêm ( 1 - thành công; 0 - bị trùng k thêm)'
