--
-- Create procedure `Proc_GetTemporaryTaxRecord`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetTemporaryTaxRecord (IN keyword varchar(255), IN month int, IN year int, IN organizationID char(36), IN incomeType int(11))
BEGIN
  DECLARE keywordLike varchar(255) DEFAULT NULL;
  IF (keyword IS NOT NULL) THEN
    SET keywordLike = CONCAT('%', keyword, '%');
  END IF;

  SELECT
    COUNT(*) AS ToTalRecord
  FROM TemporaryTax t
  WHERE t.OrganizationID = organizationID
  AND (year = 0
  OR year IS NULL
  OR (year = t.PeriodYear))
  AND (keyword IS NULL
  OR (t.TemporaryTaxName LIKE keywordLike))
  AND (month = 0
  OR month IS NULL
  OR ((CASE WHEN t.TemporaryTaxType = 1 AND
      month <= 12 AND
      month > 0 THEN t.PeriodMonthOrQuarter = month WHEN t.TemporaryTaxType = 2 AND
      month > 12 THEN (t.PeriodMonthOrQuarter = month - 12) END)))
  AND (incomeType IS NULL
  OR (incomeType = 0)
  OR (incomeType = t.IncomeType));

END
$$

--
-- Create procedure `Proc_GetTaxInfoByTemporaryID`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetTaxInfoByTemporaryID (IN temporaryTaxID char(36))
BEGIN
  CREATE TABLE tableTaxType (
    PeriodYear int DEFAULT 0,
    PeriodMonthOrQuarter int DEFAULT 0,
    IncomeType int DEFAULT 0,
    TemporaryTaxType int DEFAULT 0
  );
    SELECT
      tt.PeriodYear AS PeriodYear,
      tt.PeriodMonthOrQuarter AS PeriodMonthOrQuarter,
      tt.IncomeType AS IncomeType,
      tt.TemporaryTaxType AS TemporaryTaxType
    FROM TemporaryTax tt
    WHERE temporaryTaxID = tt.TemporaryTaxID;
  SELECT
    ti.*
  FROM TaxInfo ti,
       tableTaxType tt
  WHERE ti.TaxType = tt.IncomeType
  AND (CASE WHEN tt.TemporaryTaxType = 1 THEN (STR_TO_DATE(CONCAT(CAST(tt.PeriodMonthOrQuarter AS char), ',', '1', ',', CAST(tt.PeriodYear AS char)), '%m,%d,%Y') >= ti.ApplyDate
        AND (STR_TO_DATE(CONCAT(CAST(tt.PeriodMonthOrQuarter AS char), ',', '1', ',', CAST(tt.PeriodYear AS char)), '%m,%d,%Y') < ti.FinishApplyDate
        OR ti.FinishApplyDate IS NULL)
        ) WHEN tt.TemporaryTaxType = 2 THEN (STR_TO_DATE(CONCAT(tt.PeriodMonthOrQuarter * 3, ',', '1', ',', tt.PeriodYear), '%m,%d,%Y') < ti.FinishApplyDate
        OR ti.FinishApplyDate IS NULL)
        AND (STR_TO_DATE(CONCAT(tt.PeriodMonthOrQuarter * 3 - 2, ',', '1', ',', tt.PeriodYear), '%m,%d,%Y') >= ti.ApplyDate) END);
  DROP TABLE tableTaxType;
END
$$

--
-- Create procedure `Proc_GetDeclarationParitalBefore`
--
CREATE PROCEDURE Proc_GetDeclarationParitalBefore (IN DeclarationPartialID char(36))
SQL SECURITY INVOKER
COMMENT 'Lấy các tờ khai thuế trong các kì trong năm đó theo id chi tiết tờ khai '
BEGIN
  DECLARE x int DEFAULT 1;
  CREATE TABLE temporaryTaxInfo (
    PeriodYear int,
    GroupType int,
    IncomeType int,
    PeriodMonthOrQuarter int,
    TemporaryTaxType int,
    OrganizationID char(36)
  );

    SELECT
      tt.PeriodYear,
      tt.GroupType,
      tt.IncomeType,
      tt.PeriodMonthOrQuarter,
      tt.TemporaryTaxType,
      tt.OrganizationID
    FROM TemporaryTax tt
      LEFT JOIN DeclarationPartial dp
        ON dp.TemporaryTaxID = tt.TemporaryTaxID
    WHERE dp.DeclarationPartialID = DeclarationPartialID;

  CREATE TABLE lastDeclarationInPeriod LIKE DeclarationPartial;
  WHILE x < (SELECT
        ti.PeriodMonthOrQuarter
      FROM temporaryTaxInfo ti) DO
      SELECT
        dp.*
      FROM DeclarationPartial dp
        LEFT JOIN TemporaryTax tt
          ON tt.TemporaryTaxID = dp.TemporaryTaxID
      WHERE tt.TemporaryTaxType = (SELECT
          TemporaryTaxType
        FROM temporaryTaxInfo ti)
      AND tt.PeriodYear = (SELECT
          PeriodYear
        FROM temporaryTaxInfo ti)
      AND tt.IncomeType = (SELECT
          IncomeType
        FROM temporaryTaxInfo ti)
      AND tt.OrganizationID = (SELECT
          ti.OrganizationID
        FROM temporaryTaxInfo ti)
      AND tt.PeriodMonthOrQuarter = x;
    SET x = x + 1;
  END WHILE;
  SELECT
    *
  FROM lastDeclarationInPeriod;
  DROP TABLE lastDeclarationInPeriod;
  DROP TABLE temporaryTaxInfo;
END
$$

--
-- Create procedure `Proc_CheckTemporaryTax`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_CheckTemporaryTax (IN incomeType int, IN temporaryTaxType int, IN periodMonthOrQuarter int, IN year int, IN organizationID char(36))
COMMENT 'Check xem có thể thêm mới bảng tính thuế hay không'
BEGIN
  DECLARE Status int(11) DEFAULT 0;
  CREATE TABLE TableBuff (
    PeriodMonthOrQuarter int DEFAULT 0,
    TemporaryTaxType int DEFAULT 0,
    GroupDeclaration int DEFAULT 0
  );
  IF (year <= EXTRACT(year FROM NOW())) THEN
      SELECT
        t.PeriodMonthOrQuarter,
        t.TemporaryTaxType,
        t.incomeType
      FROM TemporaryTax t
      WHERE organizationID = t.OrganizationID
      AND year = t.PeriodYear
      AND incomeType = t.IncomeType
      ORDER BY t.CreatedDate;
    IF (NOT EXISTS (SELECT
          tf.PeriodMonthOrQuarter
        FROM TableBuff tf)) THEN
      SET Status = 0;                /* Có thể tạo bảng tính */
    ELSEIF (temporaryTaxType = 2
      AND (EXISTS (SELECT
          f.PeriodMonthOrQuarter
        FROM TableBuff f
        WHERE f.TemporaryTaxType = 1
        AND f.PeriodMonthOrQuarter BETWEEN (periodMonthOrQuarter * 3 - 2) AND periodMonthOrQuarter * 3))) THEN
      SET Status = 2;
    ELSEIF (temporaryTaxType = 1
      AND (EXISTS (SELECT
          f.PeriodMonthOrQuarter
        FROM TableBuff f
        WHERE f.TemporaryTaxType = 2
        AND f.PeriodMonthOrQuarter = (periodMonthOrQuarter + 2) DIV 3))) THEN
      SET Status = 2;
    /*Kì kê khai không hợp lệ*/
    ELSEIF (periodMonthOrQuarter IN (SELECT
          f.PeriodMonthOrQuarter
        FROM TableBuff f)
      AND (TemporaryTaxType IN (SELECT
          f.TemporaryTaxType
        FROM TableBuff f
        WHERE f.periodMonthOrQuarter = periodMonthOrQuarter))) THEN
      SET Status = 1;            /*Đã tồn tại tờ khai*/
    ELSEIF (periodMonthOrQuarter > EXTRACT(MONTH FROM NOW())
      AND temporaryTaxType = 1
      AND year = EXTRACT(year FROM NOW())) THEN
      SET Status = 3;           /*Tháng lớn hơn tháng hiện tại*/
    ELSEIF (periodMonthOrQuarter > EXTRACT(QUARTER FROM NOW())
      AND temporaryTaxType = 2
      AND year = EXTRACT(year FROM NOW())) THEN
      SET Status = 4;            /*Quý lớn hơn quý hiện tại*/
    ELSE
      SET Status = 0;
    END IF;
  ELSE
    SET Status = 5;      /*Năm lớn hơn năm hiện tại*/
  END IF;
  DROP TABLE TableBuff;
  SELECT
    Status AS Result;
END
$$

