--
-- Create procedure `Proc_CheckExistOtherDeclarationPartial`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_CheckExistOtherDeclarationPartial (IN temporaryTaxID char(36))
COMMENT 'Check tờ khai có phần chi tiết tờ khai thuộc bảng tính khác không '
BEGIN
  DECLARE incomeType int DEFAULT 0;
  SET incomeType = (SELECT
      tt.IncomeType
    FROM TemporaryTax tt
    WHERE tt.TemporaryTaxID = temporaryTaxID);
  IF ((SELECT
        COUNT(dp.DeclarationPartialID)
      FROM DeclarationPartial dp
        LEFT JOIN Declaration d
          ON d.DeclarationID = dp.DeclarationID
      WHERE dp.IncomeType <> incomeType) > 0) THEN
    SELECT
      1 AS Result;
  ELSE
    SELECT
      0 AS Result;
  END IF;
END
$$

