--
-- Create procedure `Proc_InsertDeclarationPartialWithDetail`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_InsertDeclarationPartialWithDetail (IN DeclarationPartialID char(36), IN TemporaryTaxID char(36), IN DeclarationID char(36), IN IncomeType int, IN CreatedBy varchar(100))
COMMENT 'Thêm mới chi tiết tờ khai bằng id bảng tính và id tờ khai thuế'
BEGIN
  IF (DeclarationPartialID IS NULL
    OR DeclarationPartialID = '00000000-0000-0000-0000-000000000000') THEN
    SET DeclarationPartialID = UUID();
  END IF;
    SELECT
      DeclarationPartialID AS DeclarationPartialID,
      temporaryTaxID AS TemporaryTaxID,
      declarationID AS DeclarationID,
      tt.IncomeType AS IncomeType,
      COUNT(ttd.TemporaryTaxDetailID) AS NumberOfEmployee,
      SUM(CASE WHEN ttd.ContractOffical = TRUE AND
          ttd.IndividualResident THEN 1 ELSE 0 END) AS NumberOfResidentContract,
      SUM(CASE WHEN (ttd.IndividualResident = TRUE AND
          ttd.IsTaxable = TRUE) THEN 1 ELSE 0 END) AS NumberOfEmployeeDeductResident,
      SUM(CASE WHEN (ttd.IndividualResident = FALSE AND
          ttd.IsTaxable = TRUE) THEN 1 ELSE 0 END) AS NumberOfEmployeeDeductNonResident,
      SUM(CASE WHEN ttd.IndividualResident = TRUE THEN ttd.IncomeTaxable ELSE 0 END) AS TotalIncomeTaxResident,
      SUM(CASE WHEN ttd.IndividualResident = FALSE THEN ttd.IncomeTaxable ELSE 0 END) AS TotalIncomeTaxNonResident,
      SUM(CASE WHEN ttd.IndividualResident = TRUE AND
          ttd.IsTaxable THEN ttd.TotalIncomeTaxable ELSE 0 END) AS TotalIncomeTaxDeductedResident,
      SUM(CASE WHEN ttd.IndividualResident = FALSE AND
          ttd.IsTaxable THEN ttd.TotalIncomeTaxable ELSE 0 END) AS TotalIncomeTaxDeductedNonResident,
      SUM(CASE WHEN ttd.IndividualResident = TRUE THEN ttd.TotalTaxWithHeld ELSE 0 END) AS TotalTaxResident,
      SUM(CASE WHEN ttd.IndividualResident = FALSE THEN ttd.TotalTaxWithHeld ELSE 0 END) AS TotalTaxNonResident,
      SUM(ttd.TotalTaxWithHeld) AS TotalTaxWithHeld,
      SUM(ttd.TotalIncome) AS TotalIncome,
      SUM(ttd.IncomeTaxable) AS IncomeTaxable,
      SUM(ttd.TaxIncurred) AS TaxIncurred,
      SUM(ttd.TotalReduction) AS TotalReduction,
      CreatedBy,
      NOW(),
      CreatedBy,
      NOW()
    FROM TemporaryTaxDetail ttd
      LEFT JOIN TemporaryTax tt
        ON tt.TemporaryTaxID = ttd.TemporaryTaxID
    WHERE ttd.TemporaryTaxID = temporaryTaxID
    GROUP BY tt.TemporaryTaxID;
  SELECT
    DeclarationPartialID AS Result;
END
$$

--
-- Create procedure `Proc_InsertDeclarationPartialByTemporaryID`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_InsertDeclarationPartialByTemporaryID (IN temporaryTaxID char(36), IN declarationID char(36))
COMMENT 'Thêm mới chi tiết tờ khai bằng id bảng tính và id tờ khai thuế'
BEGIN
    SELECT
      UUID() AS DeclarationPartialID,
      temporaryTaxID AS TemporaryTaxID,
      declarationID AS DeclarationID,
      tt.IncomeType AS IncomeTpype,
      COUNT(ttd.TemporaryTaxDetailID) AS NumberOfEmployee,
      COUNT(CASE WHEN ttd.ContractOffical THEN ttd.TemporaryTaxDetailID ELSE 0 END),
      COUNT(CASE WHEN ttd.IndividualResident = TRUE AND
          ttd.IsTaxable = TRUE THEN ttd.TemporaryTaxDetailID ELSE 0 END) AS NumberOfEmployeeDeductResident,
      COUNT(CASE WHEN ttd.IndividualResident = FALSE AND
          ttd.IsTaxable = FALSE THEN ttd.TemporaryTaxDetailID ELSE 0 END) AS NumberOfEmployeeDeductNonResident,
      SUM(CASE WHEN ttd.IndividualResident = TRUE THEN ttd.IncomeTaxable ELSE 0 END) AS TotalIncomeTaxResident,
      SUM(CASE WHEN ttd.IndividualResident = FALSE THEN ttd.IncomeTaxable ELSE 0 END) AS TotalIncomeTaxNonResident,
      SUM(CASE WHEN ttd.IndividualResident = TRUE AND
          ttd.IsTaxable THEN ttd.TotalIncomeTaxable ELSE 0 END) AS TotalIncomeTaxDeductedResident,
      SUM(CASE WHEN ttd.IndividualResident = FALSE AND
          ttd.IsTaxable THEN ttd.TotalIncomeTaxable ELSE 0 END) AS TotalIncomeTaxDeductedNonResident,
      SUM(CASE WHEN ttd.IndividualResident = TRUE THEN ttd.TotalTaxWithHeld ELSE 0 END) AS TotalTaxResident,
      SUM(CASE WHEN ttd.IndividualResident = FALSE THEN ttd.TotalTaxWithHeld ELSE 0 END) AS TotalTaxNonResident
    FROM TemporaryTaxDetail ttd
      LEFT JOIN TemporaryTax tt
        ON tt.TemporaryTaxID = ttd.TemporaryTaxID
    WHERE ttd.TemporaryTaxID = temporaryTaxID
    GROUP BY ttd.TemporaryTaxID;
END
$$

--
-- Create procedure `Proc_GetTemporaryTaxPaging`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetTemporaryTaxPaging (IN keyword varchar(255), IN month int, IN year int, IN pageIndex int, IN pageSize int, IN organizationID char(36), IN taxType int(11))
BEGIN

  DECLARE temp int(11) DEFAULT 0;
  SET temp = (pageIndex - 1) * pageSize;
  SELECT
    tt.*,
    COUNT(ttd.EmployeeID) AS NumberOfEmployees,
    COUNT(ttd.IsTaxable = 1) AS IsTaxable,
    SUM(ttd.TotalTaxWithHeld) AS TotalTaxWithHeld,
    (COUNT(dp.DeclarationPartialID) - 1) AS DeleteStatus
  FROM TemporaryTax tt
    LEFT JOIN TemporaryTaxDetail ttd
      ON tt.TemporaryTaxID = ttd.TemporaryTaxID
    LEFT JOIN DeclarationPartial dp
      ON dp.TemporaryTaxID = tt.TemporaryTaxID
  WHERE tt.OrganizationID = organizationID
  AND (year = 0
  OR year IS NULL
  OR (year = tt.PeriodYear))
  AND (keyword IS NULL
  OR (tt.TemporaryTaxName LIKE CONCAT('%', keyword, '%'))
  OR keyword = ''
  OR tt.TemporaryTaxName LIKE CONCAT('%', keyword, '%'))
  AND (month = 0
  OR month IS NULL
  OR ((CASE WHEN tt.TemporaryTaxType = 1 AND
      month <= 12 AND
      month > 0 THEN tt.PeriodMonthOrQuarter = month WHEN tt.TemporaryTaxType = 2 AND
      month > 12 THEN (tt.PeriodMonthOrQuarter = month - 12) END)))
  AND (taxType IS NULL
  OR (taxType = 0)
  OR (taxType = tt.IncomeType))
  GROUP BY tt.TemporaryTaxID
  ORDER BY tt.TemporaryTaxType ASC, tt.PeriodMonthOrQuarter DESC
  LIMIT pageSize
  OFFSET temp;

END
$$

--
-- Create procedure `Proc_GetTemporaryTaxDetailRecord`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetTemporaryTaxDetailRecord (IN temporaryTaxID char(36), IN keyword varchar(255))
COMMENT 'Lấy tổng số chi tiết kê khai thuê theo id bảng tính'
BEGIN
  DECLARE keywordLike varchar(255) DEFAULT NULL;
  IF keyword IS NOT NULL THEN
    SET keywordLike = CONCAT('%', keyword, '%');
  END IF;

  SELECT
    COUNT(*) AS TotalRecord
  FROM TemporaryTaxDetail ttd
  WHERE ttd.TemporaryTaxID = temporaryTaxID
  AND (keyword IS NULL
  OR (ttd.FullName LIKE keywordLike)
  OR (ttd.EmployeeCode LIKE keywordLike));
END
$$

