      *
    FROM Employee e
    WHERE employeeID = e.employeeID
    AND organizationID = e.organizationID;
  ELSEIF (citizenIdentityNo IS NOT NULL
    OR citizenIdentityNo <> ''
    OR taxNo IS NOT NULL
    OR taxNo <> '') THEN

    CREATE TABLE employeeBuff AS SELECT
      *
    FROM Employee e
    WHERE e.organizationID = organizationID
    AND e.citizenIdentityNo = citizenIdentityNo
    AND citizenIdentityNo IS NOT NULL
    AND citizenIdentityNo <> '';
    IF EXISTS (SELECT
          *
        FROM employeeBuff b) THEN
      SELECT
        *
      FROM employeeBuff b;

    ELSE
      SELECT
        *
      FROM Employee e
      WHERE e.taxNo = taxNo
      AND taxNo IS NOT NULL
      AND taxNo <> ''
      AND e.organizationID = organizationID;
    END IF;
    DROP TABLE employeeBuff;
  ELSEIF (employeeCode IS NOT NULL
    OR employeeCode <> '') THEN
    SELECT
      *
    FROM Employee e
    WHERE e.employeeCode = employeeCode
    AND organizationID = e.organizationID;
  END IF;
END
$$

