--
-- Create procedure `Proc_GetDependentByCode`
--
CREATE PROCEDURE Proc_GetDependentByCode (IN taxCode varchar(255), IN citizenIdentityNo varchar(255), IN birthCertificateNumber varchar(255), IN organizationID char(36))
SQL SECURITY INVOKER
COMMENT 'Lay thông tin phụ thuộc theo mã '
BEGIN
  IF (taxCode IS NOT NULL
    AND taxCode <> '') THEN
    SELECT
      *
    FROM Dependent d
      LEFT JOIN Employee e
        ON e.EmployeeID = d.EmployeeID
    WHERE d.DependentTaxNo = taxCode
    AND e.OrganizationID;
  ELSEIF (citizenIdentityNo IS NOT NULL
    AND citizenIdentityNo <> '') THEN
    SELECT
      *
    FROM Dependent d
      LEFT JOIN Employee e
        ON e.EmployeeID = d.EmployeeID
    WHERE d.CitizenIdentityNo = citizenIdentityNo
    AND e.OrganizationID;
  ELSEIF (birthCertificateNumber IS NOT NULL
    OR birthCertificateNumber <> '') THEN
    SELECT
      *
    FROM Dependent d
      LEFT JOIN Employee e
        ON e.EmployeeID = d.EmployeeID
    WHERE d.BirthCertificateNumber = birthCertificateNumber
    AND e.OrganizationID;
  END IF;
END
$$

