--
-- Create procedure `Proc_CheckExisDetailOrEmployee`
--
CREATE PROCEDURE Proc_CheckExisDetailOrEmployee (IN citizenIdentityNo varchar(50))
SQL SECURITY INVOKER
COMMENT 'Check xem đã tồn tại người nộp thuế trong bảng tính thuế hay bảng người lao động chưa. Return: 0- Không tồn tại, 1- Đã tồn tại trong detail, 2- Chỉ tồn tại trong hồ sơ người nộp thuế'
BEGIN
  IF ((SELECT
        COUNT(*)
      FROM information_schema.TABLES t
      WHERE t.TABLE_SCHEMA = 'MISA_EtaxMintax_Developer'
      AND t.TABLE_NAME = 'EmployeeCheck' LIMIT 1) > 0) THEN
    DROP TABLE EmployeeCheck;
  END IF;
  CREATE TABLE EmployeeCheck (
    EmployeeID char(36) DEFAULT NULL,
    FullName varchar(255) DEFAULT NULL,
    Reason int DEFAULT 0
  );
    SELECT
      e.EmployeeID AS EmployeeID,
      e.FullName AS FullName
    FROM Employee e
    WHERE e.CitizenIdentityNo = citizenIdentityNo;

  --   Chek xem có thông tin CitizenIdentityNo trong bảng tính thuế hiện tại không
  IF NOT EXISTS (SELECT
        ttd.TemporaryTaxDetailID
      FROM TemporaryTaxDetail ttd
      WHERE ttd.CitizenIdentityNo = citizenIdentityNo) THEN
    IF (EXISTS (SELECT
          *
        FROM EmployeeCheck e)) THEN
      UPDATE EmployeeCheck ec
      SET ec.Reason = 2;
      SELECT
        *
      FROM EmployeeCheck;
    ELSE
        VALUE (0);
      SELECT
        *
      FROM EmployeeCheck;
    END IF;
  ELSE
    UPDATE EmployeeCheck ec
    SET ec.Reason = 1;
    SELECT
      *
    FROM EmployeeCheck;
  END IF;
  DROP TABLE EmployeeCheck;
END
$$

DELIMITER ;

