--
-- Create procedure `Proc_GetTemporaryTaxDetailByTemporaryID`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetTemporaryTaxDetailByTemporaryID (IN TemporaryTaxID char(36), IN keyword varchar(255), IN pageSize int, IN pageIndex int)
READS SQL DATA
COMMENT 'Xem chi tiết hồ sơ kê khai'
BEGIN
  DECLARE temp int DEFAULT 0;
  DECLARE keywordLike varchar(255) DEFAULT NULL;
  SET temp = (pageIndex - 1) * pageSize;
  IF (keyword IS NOT NULL) THEN
    SET keywordLike = CONCAT('%', keyword, '%');
  END IF;

  SELECT
    ttd.*
  FROM TemporaryTaxDetail ttd
  WHERE ttd.TemporaryTaxID = TemporaryTaxID
  AND (keyword IS NULL
  OR (ttd.FullName LIKE keywordLike
  OR ttd.EmployeeCode LIKE keywordLike))
  ORDER BY ttd.CreatedDate DESC
  LIMIT pageSize
  OFFSET temp;
END
$$

