--
-- Create procedure `Proc_GetPeriodTaxInfoByYear`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetPeriodTaxInfoByYear (IN Year varchar(24))
COMMENT 'Chon thue theo nam, status=1 thanh cong, status =2 khong ton tai ho so nao trong nam'
BEGIN
  IF (EXISTS (SELECT
        *
      FROM PeriodTax p
      WHERE p.YearTax = Year)) THEN
    SELECT
      p.PeriodTaxID,
      p.PeriodTaxName,
      p.PeriodTaxCode,
      COUNT(d.EmployeeID) AS EmployeesTax,
      COUNT(IF(d.TotalTax = 0, 1, NULL)) AS EmployeesTaxMoney,
      SUM(d.TotalTax) AS TotalTaxSalary,
      SUM(d.TotalSalary) AS TotalSalary,
      SUM(d.PersonalIncomeTax) AS PersonalIncomeTax,
      SUM(d.PersonalTaxDeduction) AS TotalDeduction,
      SUM(d.Insurance) AS Insurance,
      SUM(d.Charity) AS Charity
    FROM PeriodTax p
      LEFT JOIN PeriodTaxDetail AS d
        ON p.PeriodTaxID = d.PeriodTaxID
    WHERE p.YearTax = Year
    GROUP BY p.PeriodTaxID
    ORDER BY p.TaxMonthOrQuarter
    DESC;
  END IF;

END
$$

--
-- Create procedure `Proc_GetEmployeeByPage`
--
CREATE DEFINER = 'root'@'%'
PROCEDURE Proc_GetEmployeeByPage (IN pageIndex int, IN pageSize int, IN keyword varchar(255))
COMMENT 'Lấy danh sách nhân viên phân trang và bộ lọc'
BEGIN
  DECLARE temp int(11) DEFAULT 0;
  SET temp = pageIndex * pageSize;
  SELECT
    *
  FROM View_Employee ve
  WHERE ((INSTR(ve.FullName, keyword) <> 0
  OR INSTR(ve.EmployeeCode, keyword) <> 0)
  OR keyword IS NULL)
  LIMIT pageSize
  OFFSET temp;
END
$$

